import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import "../styles.scss";

const useStyles = makeStyles(theme => ({
  contact: {
    display: "flex",
    alignItems: "center",
    flexGrow: "1"
  }
}));

const Contact = () => {
  const classes = useStyles();
  return (
    <div className={classes.contact}>
      <h1>Sarah Goon</h1>
    </div>
  );
};

export default Contact;
